class Solution:
    def maxOperations(self, s: str) -> int:
        operations=0
        batch=0
        oneCount=0
        for i in range(len(s)):
            if s[i]=='1':
                oneCount+=1
            elif i>0 and s[i]=='0' and s[i-1]=='1':
                operations+=oneCount
        return operations
